import * as React from 'react';
import { Avatar, Box, Card, Container, Grid, IconButton, Typography } from '@mui/material';
import Navbar from './components/Navbar';
import AccountCard from './components/AccountCard';
import { Component } from 'react';
import FormAddCard from './components/FormAddCard';
import axios from 'axios';
import { RestorePageRounded } from '@mui/icons-material';
import { useEffect } from 'react';

function Home(){
    const [values, setValues] = React.useState({
        accounts: [],
        searchText: "",
    })

    useEffect(() => {
        axios
            .get('http://localhost:5000/search')
            .then(response => {setValues({accounts: response.data})})
    }, []);

    const decryptPassword = (encryption) => {
        axios.post('http://localhost:5000/decryptpassword', { 
            password: encryption.password,
            iv: encryption.iv 
        }).then((response) => {
            console.log(response.data);
        });
    };

    /*const pull_data = (data) => {
        console.log(data);
    } */ 
    
    return(
        <Box>
            <Navbar /*func={pull_data}*//>
            <Container sx={{mt: 4, mb: 4}}>
                <Grid container justifyContent="center" alignItems="center" spacing={3}>
                    {values.accounts.map(account => (
                        <AccountCard
                        key={account['ID']}
                        title={account['Name']}
                        web={account['Web']}
                        username={account['User']}
                        password={ decryptPassword({password: '3057d507acff31fbdce5b09cd0dd9f20', iv: '9dc712992d10b6e1b36f4daa4f238e02'}) }
                        />
                    ))}
                </Grid>    
            </Container>
            <FormAddCard/> 
        </Box>
    );
}
export default Home;
